import { useEffect, useState } from "react";
import { getNewToken, getUsers, getPosition, updateUsers } from "../../services/users-api";

import UserList from "../UsersList/UserList";

function App() {

  const [users, setUsers] = useState();

  useEffect(()=>{
    getUsers().then(users => {
      setUsers(users);
    })
  }).catch(error => console.log(error));


  return (
    <div>
      <h1>React app</h1>
      <button onClick={() => getNewToken()}>Get Token</button> <br/>
      <button onClick={() => getUsers()}>Get Users</button> <br />
      <button onClick={() => getPosition()}>Get Position</button>

      <UserList users={users}/>
    </div>
  );
}

export default App;
